"use strict";(self.webpackChunkway23=self.webpackChunkway23||[]).push([[2775],{19629:(e,a,t)=>{t.r(a),t.d(a,{data:()=>r});const r={key:"v-e742c166",path:"/%D0%B8%D1%81%D1%81%D0%BB%D0%B5%D0%B4%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F-%D0%B2-metabase.html",title:"Metabase. Руководство пользователя 03. Исследования в Metabase",lang:"ru-RU",frontmatter:{title:"Metabase. Руководство пользователя 03. Исследования в Metabase",date:"2019-09-03",categories:["Программы"],tags:["перевод","metabase"]},excerpt:"",headers:[{level:2,title:"Посмотрите что сделала команда",slug:"посмотрите-что-сделала-команда",children:[]},{level:2,title:"Просмотрите данные",slug:"просмотрите-данные",children:[]},{level:2,title:"Изучение коллекций",slug:"изучение-коллекции",children:[]},{level:2,title:"Изучение дашбордов",slug:"изучение-дашбордов",children:[]},{level:2,title:"Изучение сохранённых вопросов",slug:"изучение-сохраненных-вопросов",children:[]},{level:2,title:"Пользовательские вопросы",slug:"пользовательские-вопросы",children:[]}],filePathRelative:"исследования-в-metabase.md",git:{updatedTime:1692859375e3}}},74148:(e,a,t)=>{t.r(a),t.d(a,{default:()=>_});var r=t(66252),s=t(3577);const i={id:"frontmatter-title",tabindex:"-1"},l=(0,r._)("a",{class:"header-anchor",href:"#frontmatter-title","aria-hidden":"true"},"#",-1),n=(0,r.Uk)("Перевод страницы документации Metabase "),d={href:"https://metabase.com/docs/v0.33.0/users-guide/03-basic-exploration.html",target:"_blank",rel:"noopener noreferrer"},o=(0,r.Uk)("Exploring in Metabase"),h=(0,r.Uk)("."),p=(0,r.uE)('<h2 id="посмотрите-что-сделала-команда" tabindex="-1"><a class="header-anchor" href="#посмотрите-что-сделала-команда" aria-hidden="true">#</a> Посмотрите что сделала команда</h2><p>Начните с просмотра работы товарищей: уже созданных дашбордов, диаграмм и вопросов, прикреплённых на домашней странице или в коллекциях.</p><h2 id="просмотрите-данные" tabindex="-1"><a class="header-anchor" href="#просмотрите-данные" aria-hidden="true">#</a> Просмотрите данные</h2><p>Для погружения в исследование данных в Metabase нажмите на одну из баз данных внизу домашней страницы, а затем на одну из таблиц. Также к списку баз данных ведёт кнопка <strong>Browse data</strong> в верхней панели навигации. Попробуйте нажать на иконку автоматического исследования данных на любой таблице.</p><p><img src="images/metabase_ug_03_01_browse-data.png" alt="Список баз данных Metabase"></p><h2 id="изучение-коллекции" tabindex="-1"><a class="header-anchor" href="#изучение-коллекции" aria-hidden="true">#</a> Изучение коллекций</h2><p>Коллекции в Metabase похожи на каталоги. В них хранятся дашборды, диаграммы и другие коллекции. Нажмите на коллкцию в секции <strong>Our analytics</strong> домашней страницы, или нажмите <strong>Browse all items</strong> для отображения полного списка.</p><p><img src="images/metabase_ug_03_02_collection-detail.png" alt="Домашняя страница Metabase"></p><p>Полезные дашборды или вопросы закрепляют вверху коллекции. Все дашборды, закреплённые в коллекции <strong>Our Analytics</strong> отображаются на домашней странице.</p><h2 id="изучение-дашбордов" tabindex="-1"><a class="header-anchor" href="#изучение-дашбордов" aria-hidden="true">#</a> Изучение дашбордов</h2>',10),g=(0,r.Uk)("Дашборды это наборы диаграмм используемые регулярно. "),u={href:"https://metabase.com/docs/v0.33.0/users-guide/07-dashboards.html",target:"_blank",rel:"noopener noreferrer"},c=(0,r.Uk)("Узнайте больше о дашбордах"),b=(0,r.Uk)("."),m=(0,r.uE)('<p>Если вы нажмёте на часть диаграммы, такую как столбец в гистограмме, или точку на линейном графике, вы увидите меню с действиями.</p><p><img src="images/metabase_ug_03_03_drill-through.png" alt="Диаграмма в Metabase"></p><p>В этом примере с заказами пирогов распределённом по времени, нажатие на точку на этой линейной диаграмме даёт нам следующие возможности:</p><ul><li><strong>Zoom in</strong> — посмотреть распределение заказов бананового пирога в июне 2017 по времени.</li><li><strong>View these Orders</strong> — посмотреть список заказов бананового пирога в июне 2017.</li><li><strong>Break out by a category</strong> — посмотреть заказы банановых пирогов в июле 2017 разделённые по статусу клиента (новый, VIP), или другим параметрам заказа. Разные диаграммы имеют разные параметры такие как Местоположение или Время.</li></ul><p>Имейте в виду что диаграммы построенные через SQL сейчас не имеют таких параметров.</p><p>Другие диаграммы тоже позволяют вам фильтровать содержимое диаграммы или таблицы. Например, вы можете кликнуть на одном из символов неравенства чтобы посмотреть график значений колонки <code>Subtotal</code> меньших 100$ или где значения в поле <code>Purchased-at</code> превышают 1 апреля 2017.</p><p><img src="images/metabase_ug_03_04_inequality-filters.png" alt="Фильтры в Metabase"></p><p>Нажатие на идентификаторе таблицы позволяет перейти в детализированные обзор одиночной записи. Например, нажав на идентификатор клиента вы увидите весь профиль клиента.</p><h2 id="изучение-сохраненных-вопросов" tabindex="-1"><a class="header-anchor" href="#изучение-сохраненных-вопросов" aria-hidden="true">#</a> Изучение сохранённых вопросов</h2><p>Каждый график на дашборде называется &quot;вопрос&quot;. Нажатие на заголовке вопроса приведёт вас к подробному представлению этого вопроса.</p><p>При изучении подробного представления вопроса, используйте описанные выше действия. Нажимайте на заголовки таблиц чтобы увидеть больше возможностей, таких как суммирование значений столбца, или фильтрация на основе выбранного столбца.</p><p>Один из наших любимых способов исследования — опция Распределение (Distribution). Она показывает вам сколько строк в данной таблице, группируются по колонке на которую вы нажали. Так что если у вас есть таблица с пользователями и вы кликните на колонку с возрастом и выберите <strong>Distribution</strong> вы увидите гистограмму с количеством пользователей в каждой возрастной группе.</p><p><img src="images/metabase_ug_03_05_heading-actions.png" alt="Распределение в Metabase"></p><h2 id="пользовательские-вопросы" tabindex="-1"><a class="header-anchor" href="#пользовательские-вопросы" aria-hidden="true">#</a> Пользовательские вопросы</h2><p>Что делать если созданные дашборды и вопросы не подходят? Давайте изучим как задать новый вопрос.</p>',15),_={render:function(e,a){const t=(0,r.up)("OutboundLink");return(0,r.wg)(),(0,r.iD)(r.HY,null,[(0,r._)("h1",i,[l,(0,r.Uk)(" "+(0,s.zw)(e.$frontmatter.title),1)]),(0,r._)("p",null,[n,(0,r._)("a",d,[o,(0,r.Wm)(t)]),h]),p,(0,r._)("p",null,[g,(0,r._)("a",u,[c,(0,r.Wm)(t)]),b]),m],64)}}}}]);